INSERT INTO `carta_templates` (`id`, `titulo`, `contenido`, `header_image`, `footer_image`, `activo`, `fecha_creacion`, `fecha_modificacion`) VALUES
(1, 'CARTAs', '<p>Las estrategias de este tipo funcionan por otro motivo, también: refuerzan la identidad que quieres construir. Si apareces en el gimnasio cinco días seguidos —incluso si es durante solamente dos minutos—, estás sumando puntos para tu nueva identidad. No estás preocupándote por ponerte en forma. Te estás enfocando en convertirte en el tipo de persona que no falta a sus entrenamientos. Estás tomando la acción mínima necesaria para confirmar el tipo de persona que quieres llegar a ser. Raramente pensamos en el cambio de esta manera porque todos están enfocados en la meta final. Pero una lagartija es mejor que no hacer nada de ejercicio. Un minuto de práctica de guitarra es mejor que nada de práctica. Un minuto de lectura es mejor que nunca abrir un libro. Es mejor hacer menos de lo que te propusiste que no hacer nada. En algún momento, una vez que has establecido el hábito y estás cumpliendo diariamente con hacerlo, puedes empezar a combinar la regla de los dos minutos con una técnica que llamamos modelado de hábitos, 7 de tal forma que puedas elevar tu hábito hasta la meta que te habías propuesto originsdfcvsalmente. Empieza por dominar los primeros dos minutos de la versión más sencilla de la conducta que quieres convertir en hábito. Luego, avanza hasta un paso intermedio y repite el proceso —enfócate solamente en los primeros dos minutos hasta que domines esa etapa antes de avanzar al siguiente nivel—. Finalmente, terminarás dominando el hábito que originalmente habías deseado desarrollar xxmientras sigues manteniendo tu atención donde debe estar: en los primeros dos minutos de la conducta</p>', 'data:image/png;base64,', NULL, 1, '2025-05-12 11:32:27', '2025-06-13 14:08:12');

