INSERT INTO `certificado_templates` (`id`, `titulo`, `contenido`, `imagenes_config`, `fecha_creacion`, `fecha_modificacion`, `activo`) VALUES
(1, 'CERTIFICADO DE GARANTÍA', '<p><br></p><p><strong>COMERCIAL &amp; INDUSTRIAL J.V.C. S.A.C.</strong></p><p> Garantiza estas Máquinas de uso Industrial, por el término de 12 meses a partir de la fecha de compra, presentando este Certificado de Garantía y la Factura original dentro del plazo antes mencionado.</p><p>Esta garantía cubre todo defecto o falla de fabricación y/o ensamblaje que pudiera producirse en las máquinas.</p><p><strong>COMERCIAL &amp; INDUSTRIAL J.V.C. S.A.C.</strong></p><p> asegura que estos Equipos cumple con las normas de seguridad vigentes.</p><p>Las condiciones de uso, instalación y mantenimiento necesarias de este equipo deberán hacerse siguiendo y respetando las especificaciones técnicas, instalación, indicación, y consejo que se formulan en el Manual de Instrucciones que forma parte de esta garantía.</p><p><strong>La presente Garantía dejará de tener validez cuando:</strong></p><ol><li>La etiqueta de identificación y/o número de serie hubiera sido dañado, alterado o quitado.</li><li>Hayan intervenido personas ajenas al Servicio Técnico de la Firma.</li><li>No se presente la factura de compra, o la misma tuviera enmiendas y/o faltare la fecha de compra.</li><li>Se verifique que los daños fueron causados por cualquier factor ajeno al uso normal del equipo.</li><li>Se verifique que los daños se hayan producido por el transporte después de la compra, golpes o accidentes de cualquier naturaleza.</li><li>Se verifique mala manipulación del equipo y/o mal uso del mismo.</li><li>El usuario no realice el mantenimiento preventivo y/o correctivo del equipo anualmente para una buena durabilidad del motor.</li></ol><p>En caso de falla del equipo, el consumidor deberá llamar a nuestro </p><p><strong>CENTRO DE SERVICIO TÉCNICO: 980088015.</strong></p><p> Cuando el examen realizado por nuestro Personal Técnico sobre el producto y la documentación pertinente, determine que rigen los términos de la garantía, el mismo será reparado sin cargo alguno.</p><p><br></p>', '[]', '2025-03-21 18:16:38', '2025-05-20 09:13:13', 0);

