INSERT INTO `constancias` (`id`, `titulo`, `tipo`, `id_cliente`, `usuario_id`, `contenido`, `header_image`, `footer_image`, `estado`, `fecha_creacion`, `fecha_modificacion`) VALUES
(9, 'INFORME sdvcsdv', 'GARANTÍA', NULL, 60, '<h2 style=\"text-align: center;\">CONSTANCIA</h2><p><br></p><p>Por medio de la presente, se hace constar que:</p><p><br></p><p style=\"text-align: center;\"><strong>[NOMBRE DEL CLIENTE]</strong></p><p><br></p><p>Ha recibido el servicio de [TIPO DE SERVICIO] para el equipo [EQUIPO] con número de serie [NÚMERO DE SERIE], el día [FECHA].</p><p><br></p><p>Se extiende la presente constancia para los fines que el interesado considere conveniente.</p><p><br></p><p>Atentamente,</p><p><br></p><p>[NOMBRE DE LA EMPRESA]</p>', '', '', 'borrador', '2025-06-12 15:10:10', '2025-06-12 15:10:10'),
(10, 'constancia desarrrollo', 'GARANTÍA', NULL, 60, '<p>Imagina que hay un cubo de hielo sobre la mesa que está frente a ti. La habitación está fría y tú puedes ver tu propio aliento. La temperatura es de 4 grados bajo cero. Aunque sea de manera muy lenta, la habitación comienza a calentarse. Tres grados bajo cero. Dos grados bajo cero. El cubo de hielo sigue en la mesa frente a ti, sin cambios. Un grado bajo cero. Medio grado bajo cero. Todavía no ha pasado nada. De pronto la temperatura alcanza los cero grados y el hielo comienza a derretirse. Un solo grado hace la diferencia y desencadena el gran cambio. Los grandes hitos, los momentos definitorios con frecuencia son el resultado de muchos acontecimientos previos que acumulan el potencial requerido para desencadenar un gran cambio. Este mismo patrón se repite en todas partes. El cáncer es indetectable el 80% del tiempo desde que surge hasta que, en un momento dado, en cuestión de meses, acaba con el cuerpo. 18 El bambú apenas se alcanza a ver durante los primeros cinco años. Durante ese tiempo desarrolla un complejo sistema de raíces que, una vez maduro, le permite crecer más de 2 m en menos de seis semanas. De manera similar, los hábitos con frecuencia no parecen provocar ningún cambio hasta que se alcanza un punto crítico, un umbral que desencadena un nivel superior de desempeño. En las etapas tempranas y medias de cualquier empresa, suele haber un</p>', '', '', 'borrador', '2025-06-12 16:50:54', '2025-06-12 16:50:54'),
